Lucky is een eenvoudige kruimeldief die er mee instemt om op een som vals geld te passen voor een vriend die problemen heeft met het gerecht. Wanneer na twee maanden het geld nog steeds niet is opgehaald, besluit hij het te verbranden om geen problemen te krijgen - wat resulteert in een bezoek aan de eerste hulp. Hier ontmoet hij Bridget waarmee hij een date regelt. De date verloopt zonder problemen totdat twee mannen hem knevelen en in de kofferbak van hun auto gooien. Het blijkt dat de twee mannen het geld van Lucky's vriend hebben gekocht en terug willen hebben, het complete bedrag van 150.000 pond. Lucky zal snel moeten scoren en besluit met een oude vriend een casino te beroven. Dit gaat echter ook niet helemaal volgens plan...



